import React from "react";

export default function TextForm(props) {
  return (
    <div>
      <h1>{props.heading}</h1>

      <div className="mb-3">
        <textarea
          className="form-control"
          placeholder="Leave a comment here"
          id="floatingTextarea"
          rows="8"
        ></textarea>
      </div>
      <button className="btn btn-primary">Convert to Uppercase</button>
    </div>
  );
}
